import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on account dropdown to reveal profile options
    await page.waitForSelector('.account-lists', { timeout: 5000 });
    await page.click('.account-lists');

    // Wait for dropdown content and click on Your Profile link
    await page.waitForSelector('.dropdown-content', { timeout: 5000 });
    await page.click('.dropdown-content a:has-text("Your Profile")');

    // Wait for profile page to load and verify we're on Jun's profile
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.waitForSelector('.profile-info h2', { timeout: 5000 });

    // Extract profile information to verify successful navigation
    const profileName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.username', el => el.textContent.trim());

    // Take screenshot of profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    return {
      success: true,
      action: "Navigated to Jun's Profile",
      extractedData: {
        profileName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
